import { SignUpForm } from "../components/SignUpForm";

export const SignUpPage = () => {
  return <SignUpForm />;
};

import bg_photo from "../img/Bg-image.svg";
import bg_logo from "../img/bg_logo.svg";

export const LogInPage = () => {
  return (
      <section className="flex justify-center items-center">
        <div className="flex-1 flex justify-center items-center pl-12">
          <LoginForm />
        </div>
        <div className="relative flex-1">
          <img
            src={bg_photo}
            alt=""
            className="w-40vw max-h-screen object-cover"
          />
          <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 z-10 text-center">
            <img src={bg_logo} alt="" />
            <p className="text-8xl font-bold text-white">Analytix</p>
          </div>
        </div>
      </section>
  );
};
